jpg?oh=be71850802b357542f52c7205ae9f0ec\u0026oe=556D55FA\u0026__gda__=1428981301_a6abd05c6ee371670221162dc08cc2be"}},{"id":"287737267996255_643522339022826","title":"\u003Ca class=\u0022facebook-link\u0022 href=\u0022https:\/\/www.facebook.com\/DangerLiveVoltage\u0022 target=\u0022_blank\u0022\u003EDanger Live Voltage\u003C\/a\u003E shared \u003Ca class=\u0022facebook-link\u0022 href=\u0022https:\/\/www.facebook.com\/app_scoped_user_id\/10152980828679759\/\u0022 target=\u0022_blank\u0022\u003EJoris Vandereyt\u003C\/a\u003E\u0027s event.","date":"27\/01\/2014","likes":"","comments":[],"message":"https:\/\/www.facebook.com\/events\/215081982001872\/?ref_dashboard_filter=upcoming","link":{"url":"https:\/\/www.facebook.com\/events\/215081982001872\/","name":"Punkfest: 5 jaar (Restarts, Cop on Fire, Counter Attack, Kezus Krijst, ...)","description":"Limbabwe Alcoholchaos\n\nZaterdag 1 februari, 2014\n\nMet twee jaar vertraging komt hij er dan toch, de vijfde editie van Punkfest.\nDeze zal nog steeds doorgaan in Zonhoven.\n\nThe Restarts (UK, punklegends)\nCounter Attack (anarchopunk)\nCop on Fire (dub the punks)\nKezus Krijst (nl, streetpunk REUNIESHOW)\nCheap Drugs (80\u0027s hardcorepunk)\nHavoc (old skool hardcore)\nLobotomy? (skadubpunks)\nLost Union (sludgepunk)\nPollution (punk)\n\nReproach had to cancel the gig.\n\nLocatie: Harmoniezaal v.d. Kwint, Heuvenstraat 9, Zonhoven\nDeuren: 15.00\nStart: 15.30\nPrijs: \u20ac6 \u003C 18.00 \u003E \u20ac8\nInfo and contact for distro\u0027s: thebackbones@ hotmail.com\n\n15.30 \u2013 16.00 Pollution\n16.30 \u2013 17.00 Lost Union\n17.30 \u2013 18.00 Lobotomy\n18.30 \u2013 19.00 Havoc\n19.30 \u2013 20.00 Cheap Drugs\n20.30 \u2013 21.10 Kezus Krijst\n21.40 \u2013 22.20 Cop On Fire\n22.50 \u2013 23.30 Counter Attack\n00.00 \u2013 ??.?? The Restarts\n\n\nBUSINFO: \n\nZaal ligt aan de kerk van Zonhoven dorp, bus stopt er ook vlak aan. \nZonhoven is gelegen naast Hasselt, dus trein pakken naar het station van Hasselt of Kiewit, en dan moet je 10 minuten op de bus zitten. \nDe bussen die vlak voor de zaal stoppen zijn de volgende: 2, 13, 22, 35, 48.\n\nZonhoven is located near Hasselt so you have to take the train to Hasselt or Kiewit station.  After that you have to take the bus. You can choose between the 2, 13, 22, 35, 48. It only takes 10 minutes. The venue is near the church, so that\u2019s where you have  to get out. \n\nVoor de mensen die afstappen aan het treinstation van zonhoven:\t\nEngstegenseweg90, Zonhoven\n1. Vertrek in noordelijke richting op de Engstegenseweg naar Beskensstraat\t\n1,3 km\n2. Weg vervolgen naar Dorpsplein\t\n150 m\n3. Sla rechtsaf naar de Dorpsstraat\t\n350 m\n4. Dorpsstraat draait iets naar rechts en wordt Heuvenstraat\/N715a\nU vindt uw bestemming links\n93 m\n\t\nHeuvenstraat 9\n3520 Zonhoven","picture":"https:\/\/fbcdn-sphotos-h-a.akamaihd.net\/hphotos-ak-xpa1\/v\/t1.0-9\/c0.44.320.320\/p320x320\/1495473_10152103386584759_700378311_n.jpg?oh=7df0301a31f9b007cb7546336f77bb78\u0026oe=5531BA7F\u0026__gda__=1432434312_139e3025634cfb553634a6456bced625"}},{"id":"287737267996255_643511712357222","title":"\u003Ca class=\u0022facebook-link\u0022 href=\u0022https:\/\/www.facebook.com\/DangerLiveVoltage\u0022 target=\u0022_blank\u0022\u003EDanger Live Voltage\u003C\/a\u003E shared a link","date":"27\/01\/2014","likes":"1 vip Rock this","comments":[],"message":"Zin in meer Voltage?\nMaak kans op 2 vrijkaarten voor het volgende evenement van Danger Live Voltage..\n\nHet enige wat je moet doen is heel eventjes deze enqu\u0026ecirc;te invullen! \n\nGood luck, dear Volties!","link":{"url":"http:\/\/www.enquetemaken.be\/toonenquete.php?id=171603","name":"Doelgroeponderzoek Danger Live Voltage | EnqueteMaken.be","description":"Ik ben student communicatiemanagement aan de Erasmushogeschool Brussel en voer in het kader van mijn afstudeerproject een doelgroeponderzoek uit naar het publiek van Danger Live Voltage. Deze non-profit organisatiewil lokaal een sterke speler worden door